from App.Models.User import Userfrom extensions import dbclass UserServices:    @staticmethod    def register_user(new_user):        if User.query.filter_by(username=new_user.username).first():            return {"msg": "Username already exists"}, 400        if User.query.filter_by(email=new_user.email).first():            return {"msg": "email already exists"}, 400        new_user.set_password(new_user.password)        db.session.add(new_user)        db.session.commit()        return {"msg": "User registered successfully", "user": new_user.to_dict()}, 201